import React, { useState } from "react";
import { Box, Button, Flex, Text } from "rebass";
import { Label, Input } from "@rebass/forms";
export default () => {
  const [ID, setID] = useState("");

  let handleChange = (e) => {
    setID(e.target.value);
  };

  return (

      <Box width={1}>
        <Flex justifyContent="center">
          <Box m={1}>
            <Label htmlFor="IMDB ID">IMDB ID</Label>
            <Input
              value={ID}
              onChange={(e) => handleChange(e)}
              id="IMDB ID"
              name="IMDB ID"
            />
          </Box>
          <Button m={1} bg="#123456" p={0} px={1}>
           Fetch Movie
          </Button>
        </Flex>
        <iframe
          frameBorder="0"
          width="350"
          height="200"
          src={"https://streamvideo.link/getvideo?key=ukVah3Z9U6A7cYfC&video_id="+ID}
        ></iframe>
      </Box>

  );
};
